import React from "react";
import style from './Task.module.css';

const Task = (props) => {
    return (
        <div className='task'>
            <div className='leftSide'>
                <div className='check'>
                    <input type="checkbox" />
                </div>
                <div className='taskTexst'>Do something</div>
            </div>
            <div className='rightSide'>
                <div className='taskDate'> 10.04.2020</div>
                <div className='deleteTask'>
                    <img className="delete-button border-img"
                        src="./image/trash.jpg" alt="done" width="40px" height="40px" />
                </div>
            </div>
        </div>
    )
}

export default Task;
